import React, {Component} from 'react';
import './App.css';

class form extends Component {
  constructor(props) {
    super();
    this.question = props.question;
  }

render() {
  return (
    <form id="survey-form">
          <h2> {this.question} </h2>

         <button type="submit" id="submit" class="submit-button">
          Submit
        </button>

     </form>
);
}
}

export default form;
